import { SIGNUP, SIGNIN } from '../actions/types';

const usersReducer = (state = {}, action) => {
  switch (action.type) {
    case SIGNUP:
      console.log('signup working in usersReducer');
      return {
        ...state,
      };
    case SIGNIN:
      console.log('signin working in usersReducer');
      return {
        ...state,
      };
    default:
      return state;
  }
};
export default usersReducer;
